"use strict";

import SvgIcon from "../../SvgIcon";
import { close } from "../../SvgIconDefinitions";

/**
 * The Close icon class constructor
 * @class Close
 * @extends SvgIcon
 */
export default class Close extends SvgIcon {
    /**
     * @inheritDoc
     */
    get _name() {
        return "Close";
    }

    /**
     * @inheritDoc
     */
    initialProps() {
        const props = super.initialProps();
        return Object.assign(props, {
            path: [ close ]
        });
    }
}
